result:
.sqlAnalysis {
  display: flex;
  height: calc(100vh - 135px);
  background: #fff;
  margin: 0 16px 16px 16px;
  padding: 16px;
  border-radius: 8px;
  overflow: hidden;
  position: relative;
  .left {
    .tree {
      width: 300px;
      height: 100%;
      max-height: 620px;
      overflow: auto;
      .el-tree {
        margin-top: 8px;
        padding-top: 8px;
        height: calc(100% - 38px);
      }
    }
  }
  .right {
    flex: 1;
    margin-left: 20px;
    .textarea {
      display: flex;
      height: 150px;
      width: 100%;
      .btns {
        width: 100px;
        margin-right: 8px;
        display: flex;
        flex-direction: column;
        justify-content: space-between;
        .el-button {
          margin: 0;
        }
        .el-button--primary {
          background-color: #409EFF;
        }
      }
    }
    .el-table {
      width: 100%;
      margin-top: 24px;
      overflow-x: scroll;
      .cell {
        white-space: nowrap;
        overflow: hidden;
        text-overflow: ellipsis;
      }
    }
    // 分页
    .pagination {
        position: absolute;
        bottom: 5px;
        right: 20px;
        height: 64px;
        display: flex;
        align-items: center;
        flex-direction: row-reverse;
        .el-pagination {
            margin: 0;
        }
    }
  }
}
